        <div class=""foot"" style=""background:#222222!important; width:100%!important;height:100vh!important;padding:40px!important;"">
            <h1>About</h1>
            <div style=""text-align:justify;"">
                Africaconnect is a tour and travelling company founded by Richard Mashinge in 2016. Our offices are in Victoria Fall. I have 15 years of experience in Overlanding guiding in Eastern and Southern African Countries. As the founder of the company , I am leading a team of most experienced guides in the industry. Most of our guides are born and raised in Africa and they know Africa like the back of their palm. Currently we are running tour in Southern Africa t");
                WriteLiteral(@"hough we are flexible enough to arrange tailor made tours in East Africa
                Travelling in Africa is unpredictable. Expect the unexpected. Our tours and transfers are in two, some luxurious and some are not. If you approach your trip with a spirit of adventure and a positive attitude, you and your fellow passengers will get the most out of the journey.
            </div>

            <h1>Our vehicles</h1>
            <div style=""text-align:justify;"">
                Our vehicles are all serviced and maintained at workshops in the countries we visit. All of our vehicles are not air conditioned and but well maintained to give the best of a safe and enjoyable ride. Our drivers are trained to attend to any minor mechanical problems that may be experienced along the way and as such it is rare for a trip to be delayed due to mechanical breakdown.
            </div>

            <h1>Trip Length</h1>
            <div style=""text-align:justify;"">
                Not everyone has the luxury of mo");
                WriteLiteral(@"re than 3 weeks of holiday in one go, so we have designed our itineraries to interlink so you can enjoy as much, or as little as you would like. We offer tours ranging from 2 to 58days in duration of camping or accommodated tours. Whether you are a young professional looking for a 10  day break, a student looking to combine a safari with and exchange or volunteer program, a family wanting to experience an African adventure together or a diehard expedition traveller , look no further we have something for all.
            </div>

            <h1>Crew</h1>
            <div style=""text-align:justify;"">
                Our camping and accommodated trips have 2 crew members, a driver and the Trip Leader who is also the cook. Your Trip leader is generally African and has a wealth of experience which they are more than happy to share. They have also travelled through Africa, either independently or as a passenger and have travelled for a number of years which makes them able to run successfully throughout the r");
                WriteLiteral(@"oute we travel. All crew are guides. Our crew are not expects in all aspects of the culture, history and wildlife of each area. They are employed to ensure a smooth running of your trip. That said, all of our crew have a passion for Africa and have acquired much knowledge of each area, which they will happily share. Due to circumstances beyond our control, like impassable roads or group safety, it may be necessary to make alterations to the planned itinerary. If this is necessary the Trip Leader will discuss the problem with the group and alter the itinerary accordingly. The trip leader will obviously consider the wishes of the group, but there may be occasions where they have to make an unpopular decision. In all matters relating to the trip’s running, the Trip leader’s decision will be final.
            </div>

        </div>


